arguments.schema:
{
    "title": "IMember",
    "description": "Member information type",
    "type": "object",
    "properties": {
        "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier of the member"
        },
        "name": {
            "type": "string",
            "description": "Name of the member"
        },
        "email": {
            "type": "string",
            "format": "email",
            "description": "Email address of the member"
        },
        "age": {
            "type": "number",
            "minimum": 20,
            "exclusiveMaximum": 100,
            "description": "Age of the member, must be between 20 and 100 (exclusive)"
        },
        "hobbies": {
            "type": "array",
            "items": {
                "type": "object",
                "properties": {
                    "id": {
                        "type": "string",
                        "format": "uuid",
                        "description": "Unique identifier of the hobby"
                    },
                    "name": {
                        "type": "string",
                        "description": "Name of the hobby"
                    }
                },
                "required": ["id", "name"],
                "description": "Hobby information"
            },
            "description": "List of member's hobbies"
        },
        "created_at": {
            "type": "string",
            "format": "date-time",
            "description": "Creation timestamp"
        },
        "updated_at": {
            "type": "string",
            "format": "date-time",
            "description": "Last update timestamp"
        },
        "deleted_at": {
            "oneOf": [
                {
                    "type": "null",
                    "description": "Not deleted"
                },
                {
                    "type": "string",
                    "format": "date-time",
                    "description": "Deletion timestamp"
                }
            ],
            "description": "Soft deletion timestamp"
        }
    },
    "required": [
        "id",
        "name",
        "email",
        "age",
        "hobbies",
        "created_at",
        "updated_at",
        "deleted_at"
    ]
}

